import React from 'react';
import { Link } from 'react-router-dom';
import './assets/css/pesticide.css';

const CustomSeedsPage = () => {
  const products = [
    {
      id: 1,
      name: 'Glyposate',
      image: 'https://krushikendra.com/image/cache/catalog/111/New/Glypho-500x500.png',
      price: '$3',
      rating: 7,
    },
    {
      id: 2,
      name: 'Acephate',
      image: 'data:image/jpeg;base64,',
      price: '$4',
      rating: 7.5,
    },
    {
      id: 3,
      name: 'Deet',
      image: 'data:image/jpeg;base64,',
      price: '$6',
      rating: 8.9,
    },
    {
      id: 1,
      name: 'Bonide Pyrethrin Garden Insect Spray',
      image: 'data:image/webp;base64,',
      price: '$9',
      rating: 7,
    },
    {
      id: 1,
      name: 'Pai plant pesticide',
      image: 'https://encrypted-tbn3.gstatic.com/shopping?q=tbn:ANd9GcR_dDUKJveghY5zCLXb4obpykNOrBQZAF1vTJWe8MxwOLs7k3nioSdSW8f0mF8uaZqlYUpnjQHrizuAH9H-RzWRcBtXdl3wN1ShkgKwrP3Mo_VR8__7Jl-rhNM',
      price: '$7',
      rating: 7,
    },
    {
      id: 1,
      name: 'IFFCO Urban Gardens',
      image: 'https://encrypted-tbn3.gstatic.com/shopping?q=tbn:ANd9GcRW8Ib32LhE_Kpi_Vw2CokWnHorcLyPtKlzxya3hxCLWgWL3hmyPBjmt0w7wpM7h-p2sWBe1B5DZOrtT9V0RyBNG840Kee0JbxEGYxOPRuQkFt0sX0ELgiA',
      price: '$3',
      rating: 7,
    },
  ];

  const renderRatings = (rating) => {
    return rating.toFixed(1);
  };
  const handleAddToCart = (productId) => {
    // Handle adding the product to the cart
    console.log(`Product ${productId} added to cart`);
  };
  return (
    <div className="product-page-container">
      <h2 className="seeds-head">
      <Link to="/home">  <img className="homepage-icon" src="https://cdn.icon-icons.com/icons2/2248/PNG/512/home_circle_icon_137496.png" alt="Homepage Icon" /></Link>
        pesticide
      </h2>
      <div className="product-grid">
        {products.map((product) => (
          <div className="product" key={product.id}>
            <img src={product.image} alt={product.name} className="product-image" />
            <p className="name">{product.name}</p>
            <p className="price">{product.price}</p>
            <p className="rating">Rating: {renderRatings(product.rating)}</p>
            <button className="add-to-cart-button" onClick={() => handleAddToCart(product.id)}>
              Add to Cart
            </button>
          </div>
        ))}
      </div>
    </div>
  );
};

export default CustomSeedsPage;